import React from 'react';


function Modal({ onClose }) {
    return (
        <div className="modal">
            <div className="modal-content">
                <span className="close" onClick={onClose}>&times;</span>
                <h2>Modal Title</h2>
                <p>This is the modal content.</p>
            </div>
        </div>
    );
}

export default Modal;
